import React from 'react';

import { Container, CartTitle, LeftSideCart, RightSideCart, ProductInfoCart, SectionCart } from './styles';

function Cart() {
  return(
        <Container>
                <CartTitle>Cart</CartTitle>
            <SectionCart>
                <LeftSideCart>
                    <ProductInfoCart>
                        <li>
                            <span>x</span>
                            <span>Imagen</span>
                            <span>Value</span>
                            <span>Quantity</span>
                        </li>
                    </ProductInfoCart>

                </LeftSideCart>
                <RightSideCart>
                    <h1>Box come here</h1>
                </RightSideCart>
            </SectionCart>
        </Container>
    );
}

export default Cart;
